//GET BY ID
export const getAssetResourceRequest = function(){
  return {
    type: "GET_ASSET_RESOURCE_REQUEST"
  }
}

export const getAssetResourceSuccess = function(asset) {
  return {
    type: "GET_ASSET_RESOURCE_SUCCESS",
    asset
  }
}

export const getAssetResourceError = function() {
  return {
    type: "GET_ASSET_RESOURCE_ERROR"
  }
}
